import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
} from "react-router-dom";
import React, { useState, useEffect } from "react";
import axios from "axios";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Loggedin from "./pages/Loggedin";
import Dashboard from "./pages/Dashboard";
import Invest from "./pages/Invest";
import Portfolios from "./pages/Portfolios";
import Profile from "./pages/Profile";
import Watchlist from "./pages/Watchlist";
import NoPage from "./pages/NoPage";

export default function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    axios.get("http://localhost:3000").then((res) => {
      if (res.data.valid) {
        setIsLoggedIn(true);
      }
    });
  }, []);

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={!isLoggedIn ? <Home /> : <Navigate to="/loggedin" />}
        />
        <Route
          path="/loggedin"
          element={isLoggedIn ? <Loggedin /> : <Navigate to="/" />}
        />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/dashboard/invest" element={<Invest />} />
        <Route path="/dashboard/portfolios" element={<Portfolios />} />
        <Route path="/dashboard/profile" element={<Profile />} />
        <Route path="/dashboard/watchlist" element={<Watchlist />} />
        <Route path="*" element={<NoPage />} />
      </Routes>
    </Router>
  );
}
